I have the following gear for your XDS 9mm (3.3), all of which is brand new/never used:

* Three factory mags (one flush 7 round, one "mid-mag" 8 round, and one "x-tended" 9 round) in plastic factory case;

* One dual mag pouch;

* One IWB hybrid leather/kydex holster made by "Everyday Holsters";

* One unopened box of factory brass FMJ target ammo (100 rounds). 

Total value $175+.  Will sell together for $125.

Kimber's Master Carry Ultra is a 1911-style semi auto built on an aluminum, round-heel frame with a satin silver finish. It’s chambered in .45 ACP. Comes with box all paperwork and 3 mags.

Other features include:
A stainless steel slide with and rear serrations and a black KimPro II
slide finish; a steel, 3″, match-grade, ramped barrel; a full-length guide
rod; an aluminum match-grade trigger;
Crimson Trace Master Series Lasergrips w/Kimber’s logo;
Tactical Wedge night sights; a recessed slide-stop pin; rounded edges;
and a serrated mainspring housing.
